import React from 'react'

const Square = (props) => {

  const alertIndex = () => {
    return (
      alert(`${props.index}`)
    )
  }

  return (
    <>
      <div className="square" onClick={alertIndex()}>
        {props.value}
      </div>
    </>
  )
}

export default Square
